import Carousel from "react-bootstrap/Carousel";
import carouselimg_1 from "../../Img/carousel_1.jpg";

export const CarouselInicio = () => {
    return (
        <Carousel className="w-100">
            <Carousel.Item>
                <img
                    src={carouselimg_1}
                    className="w-100"
                    alt="Primer Slide"
                />
            </Carousel.Item>
        </Carousel>
    )
}
